/*
 * @Description:
 * @Autor: liang
 * @Date: 2020-06-08 15:16:23
 * @LastEditors: liang
 * @LastEditTime: 2020-06-08 15:51:14
 */
import React from "react";
import { withRouter } from "next/router";
function Id(props) {
  return <div>123</div>;
}
Id.getInitialProps = async () => {
  const res = await fetch(
    "http://api-test.dtbird.cn/api/package/search/kp/h5/history"
  );
  console.log("rrr", res);
  const json = await res.json();
  return { stars: json.stargazers_count };
};
export default withRouter(Id);
